insert  into `bao_payment`(`payment_id`,`name`,`logo`,`code`,`mobile_logo`,`contents`,`setting`,`is_mobile_only`,`is_open`) values (1, '支付宝', 'alipay.png', 'alipay', 'alipay_mobile.png', '支付宝（中国）网络技术有限公司是国内领先的第三方支付平台，致力于提供“简单、安全、快速”的支付解决方案。支付宝公司从2004年建立开始，始终以“信任”作为产品和服务的核心。作为中国主流的第三方支付平台，我们不仅从产品上确保用户在线支付的安全，同时致力于通过担保交易等创新让用户通过支付宝在网络间建立信任的关系，去帮助建设更纯净的互联网环境。', '', 0, 1);
insert  into `bao_payment`(`payment_id`,`name`,`logo`,`code`,`mobile_logo`,`contents`,`setting`,`is_mobile_only`,`is_open`) values (22, '财付通', 'tenpay.png', 'tenpay', 'tenpay_mobile.png', '财付通（https://www.tenpay.com/v2/）是腾讯集团旗下中国领先的第三方支付平台，一直致力于为互联网用户和企业提供安全、便捷、专业的在线支付服务。自2005年成立伊始，财付通就以“安全便捷”作为产品和服务的核心，不仅为个人用户创造200多种便民服务和应用场景，还为40多万大中型企业提供专业的资金结算解决方案。', 'a:2:{s:14:"tenpay_account";s:4:"1111";s:10:"tenpay_key";s:3:"111";}', 0, 1);
insert  into `bao_payment`(`payment_id`,`name`,`logo`,`code`,`mobile_logo`,`contents`,`setting`,`is_mobile_only`,`is_open`) values (3, '微信支付', 'weixin.png', 'weixin', 'weixin_mobile.png', '微信支付是由腾讯公司知名移动社交通讯软件微信及第三方支付平台财付通联合推出的移动支付创新产品，旨在为广大微信用户及商户提供更优质的支付服务，微信的支付和安全系统由腾讯财付通提供支持。财付通是持有互联网支付牌照并具备完备的安全体系的第三方支付平台。', 'a:4:{s:5:"appid";s:18:"";s:9:"appsecret";s:0:"";s:5:"mchid";s:10:"1234311202";s:6:"appkey";s:32:"";}', 1, 1);
