insert  into `bao_payment`(`payment_id`,`name`,`logo`,`code`,`mobile_logo`,`contents`,`setting`,`is_mobile_only`,`is_open`) values (5, '银联支付', 'chinapay.png', 'chinapay', 'chinapay_mobile.png', '银联在线支付是中国银联推出的网上支付平台，支持多家发卡银行，涵盖借记卡和信用卡等，包含认证支付、快捷支付和网银支付多种方式，其中认证和快捷支付无需开通网银，仅需一张银行卡，即可享受安全、快捷的网上支付服务！www.chinapay.com', 'a:3:{s:16:"chinapay_merabbr";s:0:"";s:16:"chinapay_account";s:0:"";s:12:"chinapay_key";s:0:"";}', 0, 1);
